import React from "react";
import { Container, Menu, Segment } from "semantic-ui-react";

export const NavBar = () => {
  return (
    <Segment inverted>
      <Menu  inverted secondary>
        <Container>
      <Menu.Item header>
        <img src="/assets/logo.png" alt="logo" />
      </Menu.Item>
        
        </Container>
       
      </Menu>
    </Segment>
  );
};
